import React from 'react';
import '../index.css'; // Ensure Tailwind CSS is being imported

const items = [
  // ... your items array as provided
];

const Classifieds = () => {
  return (
    <div className="bg-gray-100 min-h-screen">
      <header className="bg-white py-4">
        <div className="container mx-auto px-4">
          <h1 className="text-3xl font-bold text-red-600">blocket</h1>
        </div>
      </header>
      <main className="container mx-auto px-4 py-6">
        <div className="grid grid-cols-1 gap-6">
          {items.map((item, index) => (
            <div key={index} className="bg-white p-4 flex items-center shadow rounded-md">
              <img src={item.image} alt={item.alt} className="w-24 h-24 mr-4" />
              <div className="flex-grow">
                <div className="text-sm text-gray-600">{item.category}</div>
                <div className="text-lg font-medium">{item.title}</div>
              </div>
              <div className="text-right">
                <div className="text-xl font-bold">{item.price}</div>
                <div className="text-sm text-gray-500">{item.time}</div>
              </div>
              <div className="flex flex-col justify-between items-center ml-4">
                {item.shipping && (
                  <span className="bg-blue-100 text-blue-800 text-xs font-semibold px-2.5 py-0.5 rounded-full mb-2">
                    Frakt med k√∂pskydd
                  </span>
                )}
                <i className="far fa-heart text-gray-400 text-xl cursor-pointer"></i>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default Classifieds;
